import React from 'react'
import { Link } from 'react-router-dom'

const Nav = ({ cart, getCartTotal }) => {
    return (
        <div className="nav">
            <Link to="/" className="nav__logo" href="">9 FIFTY</Link>
            <Link to="/cart" className="nav__cart" href="">CART- {getCartTotal}</Link>     
        </div>
    )
}

export default Nav
